import Cat from '../images/Cat.png';
import Penguin from '../images/Penguin.jpg';

const GetImagePath = (index) => {
    var images = [
        Cat,
        Penguin,
        Cat,
        Penguin,
        Cat,
    ];
    return images[index];
}
export default GetImagePath;
